CSlider::CSlider()
{
	m_Flags = UIFlags::UI_Drawable | UIFlags::UI_Clickable | UIFlags::UI_SaveFile;

	FileControlType = UIControlTypes::UIC_Slider;
}

void CSlider::Draw(bool hover)
{
	POINT a = GetAbsolutePos();
	float Ratio = Value / (Max - Min);
	float Location = Ratio*m_iWidth;
	float titler = Menu::Window.colourtab.titler.GetValue(); // default: 10
	float titleg = Menu::Window.colourtab.titleg.GetValue(); // default: 10
	float titleb = Menu::Window.colourtab.titleb.GetValue(); // default: 10
	if (titler <= 0.1)
		titler = 0.1;
	if (titleg <= 0.1)
		titleg = 0.1;
	if (titleb <= 0.1)
		titleb = 0.1;
	//Draw::Outline(a.x + 1, a.y + 6, m_iWidth - 2, 9, Color(48, 48, 48, GUI.menu_alpha));
	Render::GradientV(a.x, a.y + 5, m_iWidth, 9, Color(25, 25, 25, 255), Color(25, 25, 25, 255));
	Render::GradientV(a.x, a.y + 5, Location, 9, Color(titler - 5, titleg-5, titleb-5, 255), Color(titler, titleg, titleb, 255));
	Render::Outline(a.x, a.y + 5, m_iWidth, 9, Color(0, 0, 0, 255));


	char buffer[24];
	sprintf_s(buffer, "%0.000f", Value);
	RECT txtSize = Render::GetTextSize(Render::Fonts::ESP, buffer);
	Render::Text(a.x + Location - txtSize.right / 2, a.y + 10, Color(200, 200, 200, 255), Render::Fonts::ESP, buffer);
}

void CSlider::OnUpdate() {
	POINT a = GetAbsolutePos();
	m_iHeight = 11;

	if (DoDrag)
	{
		if (GUI.GetKeyState(VK_LBUTTON))
		{
			POINT m = GUI.GetMouse();
			float NewX;
			float Ratio;
			NewX = m.x - a.x - 1;
			if (NewX < 0.0) NewX = 0.0;
			if (NewX > m_iWidth) NewX = m_iWidth;
			Ratio = NewX / float(m_iWidth);
			Value = Min + (Max - Min)*Ratio;
		}
		else
		{
			DoDrag = false;
		}
	}
}

void CSlider::OnClick() {
	POINT a = GetAbsolutePos();
	RECT SliderRegion = { a.x, a.y, m_iWidth, 11 };
	if (GUI.IsMouseInRegion(SliderRegion))
	{
		DoDrag = true;
	}
}

float CSlider::GetValue()
{
	return Value;
}

void CSlider::SetValue(float v)
{
	Value = v;
}

void CSlider::SetBoundaries(float min, float max)
{
	Min = min; Max = max;
}

